import JsonPre from "./JsonPre";
import React from "react";
function JsonStringify() {
  const squares = [1, 4, 16, 25, 36];
  console.log(squares);
  return (
    <div>
      <h4>JsonStringify</h4>
      squares = {JSON.stringify(squares)}
      <br />
      <JsonPre json={squares} />
    </div>
  );
}

export default JsonStringify;
